def ouvrir_image_base64(image_base64):
    # Convertir la chaîne base64 en données binaires
    image_bytes = base64.b64decode(image_base64)
    return(image_bytes)


def hex_to_rgba(hex_color):
    hex_color = hex_color.lstrip('#')
    if len(hex_color) == 6:  # format #RRGGBB
        return tuple(int(hex_color[i:i+2], 16) for i in (0, 2, 4)) + (255,)  # Ajouter l'alpha
    elif len(hex_color) == 8:  # format #RRGGBBAA
        return tuple(int(hex_color[i:i+2], 16) for i in (0, 2, 4, 6))
    else:
        raise ValueError("Format invalide")

def Creer_icone(lien, Ev):
    Icon = Image.new(mode="RGBA", size=(80, 100))
    L, H = Icon.size
    NewIcon = Icon.load()  # Récupération des pixels

    # Application des couleurs basées sur l'événement
    if Ev == 'Contest':
        for l in range(L):
            for h in range(H):
                if (40-l)**2 + (40 - h)**2 < 1200 or (h < 1.5*l+30 and h < -1.5*l+150 and h > 40):  # Icône blanche
                    NewIcon[l, h] = (255, 255, 255, 255)
                elif (40-l)**2 + (40 - h)**2 < 1600 or (h < 1.5*l+40 and h < -1.5*l+160 and h > 40):  # Icône colorée
                    NewIcon[l, h] = hex_to_rgba('#850606')
    elif Ev == 'Rassemblement':
        for l in range(L):
            for h in range(H):
                if (40-l)**2 + (40 - h)**2 < 1200 or (h < 1.5*l+30 and h < -1.5*l+150 and h > 40):  # Icône blanche
                    NewIcon[l, h] = (255, 255, 255, 255)
                elif (40-l)**2 + (40 - h)**2 < 1600 or (h < 1.5*l+40 and h < -1.5*l+160 and h > 40):  # Icône colorée
                    NewIcon[l, h] = hex_to_rgba('#0a5c1f')
    elif Ev == 'Compétition':
        for l in range(L):
            for h in range(H):
                if (40-l)**2 + (40 - h)**2 < 1200 or (h < 1.5*l+30 and h < -1.5*l+150 and h > 40):  # Icône blanche
                    NewIcon[l, h] = (255, 255, 255, 255)
                elif (40-l)**2 + (40 - h)**2 < 1600 or (h < 1.5*l+40 and h < -1.5*l+160 and h > 40):  # Icône colorée
                    NewIcon[l, h] = hex_to_rgba('#fcdc12')
    elif Ev == 'Film':
        for l in range(L):
            for h in range(H):
                if (40-l)**2 + (40 - h)**2 < 1200 or (h < 1.5*l+30 and h < -1.5*l+150 and h > 40):  # Icône blanche
                    NewIcon[l, h] = (255, 255, 255, 255)
                elif (40-l)**2 + (40 - h)**2 < 1600 or (h < 1.5*l+40 and h < -1.5*l+160 and h > 40):  # Icône colorée
                    NewIcon[l, h] = hex_to_rgba('#000000')
    else:
        for l in range(L):
            for h in range(H):
                if (40-l)**2 + (40 - h)**2 < 1200 or (h < 1.5*l+30 and h < -1.5*l+150 and h > 40):  # Icône blanche
                    NewIcon[l, h] = (255, 255, 255, 255)
                elif (40-l)**2 + (40 - h)**2 < 1600 or (h < 1.5*l+40 and h < -1.5*l+160 and h > 40):  # Icône colorée
                    NewIcon[l, h] = hex_to_rgba('#FFFFFF')
    
    # Charger l'image externe à ajouter sur l'icône
    if 'http' == lien[:4]:
        Im1 = Image.open(io.BytesIO(requests.get(lien).content)).convert(mode='RGBA')
    else:
        Im1 = Image.open(io.BytesIO(lien)).convert(mode='RGBA')
    
    # Redimensionner l'image
    Newx = int(Im1.size[0]*52/max(Im1.size[0], Im1.size[1]))
    Newy = int(Im1.size[1]*52/max(Im1.size[0], Im1.size[1]))
    Im1 = Im1.resize((Newx, Newy))
    pix_origine = Im1.load()  # Récupérer les pixels

    # Ajouter l'image à l'icône
    for l in range(L):
        for h in range(H):
            if 40-Newx//2 < l < 40+Newx//2 and 40-Newy//2 < h < 40+Newy//2 and pix_origine[l-(40-Newx//2), h-(40-Newy//2)][3] > 200:
                NewIcon[l, h] = pix_origine[l-(40-Newx//2), h-(40-Newy//2)]
    
    return Icon

