def generer_popup_html(nom, site, logo, date, dateF, Ev):
    # Définir la couleur selon le type d'événement
    if Ev == 'Contest':
        couleur_hex = '#850606'  # Rouge
    elif Ev == 'Rassemblement':
        couleur_hex = '#0a5c1f'  # Vert
    elif Ev == 'Compétition':
        couleur_hex = '#fcdc12'  # or
    elif Ev == 'Film':
        couleur_hex = '#000000'  # or
    else:
        couleur_hex = '#FFFFFF'  # Noir par défaut
    
    # Générer le HTML avec la couleur insérée dynamiquement
    return Popup_html.format(nom=nom, site=site, logo=logo, date=date, dateF=dateF, couleur_hex=couleur_hex)



