###### Obfuscation du HTML 
def obfuscate_html_file(input_file, output_file):
    # Lire le fichier HTML
    with open(input_file, 'r', encoding='utf-8') as file:
        html_content = file.read()

    # Minification du HTML en supprimant les espaces inutiles
    minified_html = htmlmin.minify(html_content, remove_comments=True, remove_empty_space=True)

    # Enregistrer le fichier obfusqué dans un nouveau fichier
    with open(output_file, 'w', encoding='utf-8') as file:
        file.write(minified_html)

    print(f"Le fichier {output_file} a été obfusqué avec succès.")

# Exemple d'utilisation
obfuscate_html_file(output_file_path, output_file_path)